import { Injectable } from '@angular/core';
import { Car } from '../Classes';

@Injectable({
  providedIn: 'root',
})
export class CarService {
  private _cars: Car[] = [];
  get cars(): Car[] {
    return this._cars;
  }
 set cars(car: Car) {
    this._cars.push(car);
  }
}
